import React, { Component } from "react";

class SelectButton extends Component {
	state = {};
	render() {
		return (
			<React.Fragment>
				<li>
					<div className="collapsible-header">
						{this.props.id.charAt(0).toUpperCase() +
							this.props.id.substring(1, this.props.id.length)}
					</div>
				</li>
			</React.Fragment>
		);
	}
}

export default SelectButton;
